description:
The Beatles' Nowhere Man EP was released 8 July 1966. It included four songs from the (British) album Rubber Soul. The EP was only released in mono, with the catalogue number Parlophone GEP 8952.

(In the United States, &quot;Nowhere Man&quot; and &quot;Drive My Car&quot; were on &quot;Yesterday and Today&quot;, not on &quot;Rubber Soul&quot;.)

Track Listing [320k MP3]

    &quot;Nowhere Man&quot; 
    &quot;Drive My Car&quot; 
    &quot;Michelle&quot; 
    &quot;You Won't See Me&quot;
